import React from 'react';
import './index.css';
import { useState, useEffect } from 'react';
import { Gauge } from '@ant-design/charts';

const DemoGauge: React.FC = () => {
    var config = {
      percent: 0.75,
      range: { color: 'l(0) 0:#bde8ff 1:#9ec9ff' },
      startAngle: Math.PI,
      endAngle: 2 * Math.PI,
      indicator: null,
      statistic: {
        title: {
          offsetY: -36,
          style: {
            fontSize: '36px',
            color: '#4B535E',
          },
          formatter: function formatter() {
            return '70%';
          },
        },
        content: {
          style: {
            fontSize: '24px',
            lineHeight: '44px',
            color: '#4B535E',
          },
          formatter: function formatter() {
            return '加载进度';
          },
        },
      },
    };
    return <Gauge {...config} />;
  };

class MyPie extends React.Component {
    render() {
        return (
        <div id="pie">
            <div>

                <div class="guage1"></div>
            </div>
            <div>2</div>
            <div>3</div>
        </div>
        );
    }
}
export default MyPie
